// Add route pages
// Add style for buttons

function App() {
  return (
    <BrowserRouter>
      <Route path="/">
        <Route path="/Restaurants" component={<Restaurant />}></Route>
      </Route>
    </BrowserRouter>
  );
}

const Restaurant = () => (
  <div>
    <h2>Restaurants</h2>
  </div>
);
export default App;
